import "./Dashboard.css";
import { useSelector } from "react-redux";
import { Link } from "react-router-dom";
import Card from "react-bootstrap/Card";
import AddProduct from "../add/Add";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import CloseButton from "react-bootstrap/CloseButton";
import { useAppContext } from "../../context/appContext";
import { useEffect } from "react";

const Dash_Home = () => {
  return (
    <>
      <Row>
        <Col className=" col-md-4 mb-4 " key="f">
          <Card className="col-style ">
            <span className="edit-section">
              <Link to={`/dashboard/MangeProducts/Update/$`}>
                <i className="fa-regular fa-pen-to-square"></i>
              </Link>
            </span>

            <Row className="d-flex align-items-center">
              <Col md={4}>
                <Card.Img variant="top" src={`/img/$`} />
              </Col>
              <Col md={8}>
                <Card.Title className="text-start">
                  <h2>gf</h2>
                </Card.Title>
                <Card.Subtitle className="mt-3 text-muted text-start">
                  gf $
                </Card.Subtitle>
              </Col>
            </Row>
            <Row>
              <Col>
                <Card.Body className="mt-3">
                  <Card.Text>gf</Card.Text>
                </Card.Body>
              </Col>
            </Row>
          </Card>
        </Col>
      </Row>
    </>
  );
};

export default Dash_Home;
